import React from 'react';
import ChristianDrinking from '../images/team/ChristianDrinking.jpg';
import Beer from './components/beer';

const Home = () => {
  const style = {
    height: "400px",
    width: "400px",
  }
  return (
    <div className="container w-100 h-100" style={{marginTop:'10%'}}>
    <div className="row">
    <div className="col">
      <img src={ChristianDrinking} alt="John Nguyen" style={style}/>
    </div>
    <Beer />
      <div className="col text-center mt-10 justify-content-center align-self-center">
            <h1 className="cover-heading">Welcome to Beers & Brewskies!</h1>
            <p className="lead">Take a look around</p>
            <p className="lead">
                <a href="#" class="btn btn-primary my-2">Main call to action</a>
                <a href="#" class="btn btn-secondary my-2">Secondary action</a>
            </p>
        </div>
      </div>
    </div>
  )
}

export default Home;
